export const SHOW_COORDENATES = 'SHOW_COORDENATES'

export function showCoordenates() {
    return function (dispatch, getState)  {
        fetch('api/coordinate')
            .then(res => res.json())
            .then(data => {
                dispatch({
                    type:SHOW_COORDENATES,
                    payload:data
                })
        });
    }
}
